import React from "react";
import SweeperSlider from "../component/global/glide-slider";
import "./feature.css";

// Define your new component
const FeaturedCollection = () => {
  // Prepare slide content
  const slides = [
    {
      image: require("../assest/cycle1.jpg"),
      title: "Product 1",
      description: "Description for Product 1",
    },
    {
      image: require("../assest/cycle2.jpg"),
      title: "Product 2",
      description: "Description for Product 2",
    },
    {
      image: require("../assest/cycle3.jpg"),
      title: "Product 3",
      description: "Description for Product 3",
    },
    // Add more slides as needed
  ];

  // Custom arrow component for previous button
  const PrevArrow = (props) => {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: 'block', background: 'red' }}
        onClick={onClick}
      />
    );
  };

  // Custom arrow component for next button
  const NextArrow = (props) => {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: 'block', background: 'blue' }}
        onClick={onClick}
      />
    );
  };

  // Render the component
  return (
    <div className="collection">
      <h1>My Component</h1>
      <div className="sweeper-slider-container">
        <SweeperSlider
          slides={slides}
          className="custom-slider"
          prevArrow={<PrevArrow />}
          nextArrow={<NextArrow />}
        />
      </div>
    </div>
  );
};

export default FeaturedCollection;
